const tasks = [
  {
    id:1,
    text:'Print this'
  },{
    id:2,
    text:'Print that'
  },
]

const Tasks = () => {
  return (
    <>
    {tasks.map((tasks) => (
      <h3 key={tasks.id}> {tasks.text}</h3>
    ))}
    </>
  )
}

export default Tasks
